import React, { Component } from 'react'

export default class WorkingWithClasses extends Component {
  render() {
    const { nameClass, typeClass } = this.props
    return (
      <div>
        <label>O nome da classe é {nameClass} e o tipo da classe é {typeClass}</label>
      </div>
    )
  }
}
